import { button } from 'framer-motion/client';
import './Editor.css'

function ToolbarButton ({ title }) {
    return (
        <>
        <button type='button' className='Toolbar_button'> {title} </button>
        </>
    )
}

function Toolbar () {
    return (
        <>
        <div className='Toolbar'>
            <ToolbarButton title='button'/>
            <ToolbarButton title='button'/>
            <ToolbarButton title='button'/>
            <ToolbarButton title='button'/>
            <ToolbarButton title='button'/>
            <ToolbarButton title='button'/>
            <ToolbarButton title='button'/>
        </div>
        </>
    )
}

function Editor () {
    return (
        <>
        <div>
            <Toolbar />
        </div>
        </>
    )
}


export default function Page () {
    return (
      <>
        <div>
          <Editor />
        </div>
      </>
    );
  }
